import React, { Component } from 'react';

class Playlist extends Component {
  render() {
    return (
      <div className="col-6">
        <div className="tile double totoro">
          <div className="player text-left">
            <h6>Debug</h6>
            <div>Total Tasks: 2910</div>
            <div>Today's Tasks: 13</div>
            <div>Today's Completed: 5</div>
            <div>Today's Overdue: 0</div>
          </div>
        </div>
      </div>
    );
  }
}

export default Playlist;
